var limitInput = document.getElementById("percentage");
limitInput.value = 15;
let limit = limitInput.value;

function getCfg(limit) {
  const long = input.filter(x => x > limit).length;
  const longPercent = long * 100 / input.length;
  const data = [
    {
      id: `< ${limit} min (${Number((1 - longPercent) * 100).toFixed(2)} %)`,
      value: (1 - longPercent) * 100,
    },
    {
      id: `> ${limit} min (${Number(longPercent *100).toFixed(2)} %)`,
      value: longPercent * 100,
    },
  ];

  const cfg = {
    type: "doughnut",
    data: {
      labels: data.map(x => x.id),
      datasets: [
        {
          data: data,
        },
      ],
    },
    options: {
      parsing: {
        keys: "value",
      },
      plugins: {
        legend: {
          display: true,
          position: "right",
        },
      },
    },
  };
  document.getElementById("title").textContent = `Input Count: ${input.length}`;
  return cfg;
}

var myChart = null;
function drawChart(ctx, cfg) {
  if (myChart != null) {
    myChart.destroy();
  }
  myChart = new Chart(ctx, cfg);
}
const ctx = document.getElementById("chart");
const cfg = getCfg(limit);
document.getElementById('limit').textContent = `${limit} min`
drawChart(ctx, cfg);

limitInput.addEventListener(
  "change",
  () => {
    limit = limitInput.value;
    drawChart(ctx, getCfg(limit));
    document.getElementById('limit').textContent = `${limit} min`
  },
  false
);

